Verenigd Koninkrijk
Horror
98 minuten

geregisseerd door Colm McCarthy
met James Nesbitt, Kate Dickie en James Cosmo

Petronella is een Schotse zigeunervrouw en heeft een relatie met Fergal, een mysterieuze Ierse reiziger. Als hun verdoemde relatie bekend wordt, terroriseert een vreemd beest het landgoed. Het vermoordt de bewoners, en komt zo dichter bij Petronella en Fergal. Ondertussen zijn de mysterieuze Ierse reizigers Cathal en Liam bezig met het opvoeren van een ritueel, omdat ze jacht maken op een vampier. Ook Mary (Fergal's moeder) voert een ritueel op en is bezig met magie. Maar dan komen Cathal en Mary tegenover elkaar te staan...

